import  "../App.css"


export default function Home() {
    return (
        <div className='img d-grid gap-2 col-6 mx-auto' >
            <img src="http://tipieapp.com/www/img/tipie-logo-01.png" alt="tipie" style={{"max-width":"100%", "justify-content":"center"}}/>
            <button type="button" className="btn btn-secondary btn-lg">Entrar</button>
        </div>
    )
}
